import React from 'react';
import AccountsList from './accountsList';

class AccountsListContainer extends React.Component {
  constructor() {
    super()

    this.state = {
      books: []
    };
  }

  componentDidMount() {
    fetch('https://learn-co-curriculum.github.io/books-json-example-api/books.json')
      .then(response => response.json())
      .then(bookData => this.setState({ books: bookData.books }))
  }

  render() {
    return <AccountsList accounts={this.state.accounts} />
  }
}

export default AccountsListContainer;
